		const double A3EvenI = 0.38268343236508978 * sumB2i + 0.92387953251128674 * sumB4i;
		const double A3OddI = 0.70710678118654757 * sumB3i - a5 + a13 - a21 + a29;

		const double A3R = A3EvenR + A3OddR;
		const double A3I = A3EvenI + A3OddI;

		signalOut[(i + 2 * step) << 1] = A3R;
		signalOut[((i + 2 * step) << 1) + 1] = A3I;

		// A4
		const double A4EvenR = 0.83146961230254524 * sumA2r - 0.19509032201612836 * sumA4r - 0.98078528040323043 * sumA6r - 0.55557023301960218 * sumA8r;
		const double A4OddR = a1 + 0.38268343236508978 * sumA3r - 0.70710678118654757 * sumA5r - 0.92387953251128674 * sumA7r - a17;

		const double A4EvenI = 0.55557023301960218 * sumA2i + 0.98078528040323043 * sumA4i + 0.19509032201612836 * sumA6i - 0.83146961230254524 * sumA8i;
		const double A4OddI = 0.92387953251128674 * sumA3i + 0.70710678118654757 * sumA5i - 0.38268343236508978 * sumA7i + a9 - a25;

		const double A4R = A4EvenR + A4OddR;
		const double A4I = A4EvenI + A4OddI;

		signalOut[(i + 3 * step) << 1] = A4R;
		signalOut[((i + 3 * step) << 1) + 1] = A4I;

		// A5
		const double A5EvenR = 0.70710678118654757 * sumC2r;
		const double A5OddR = a1 - a5 + a9 - a13 + a17 - a21 + a25 - a29;

		const double A5EvenI = 0.70710678118654757 * sumC2i;
		const double A5OddI = a7 - a3 - a11 + a15 - a19 + a23 - a27 + a31;

		const double A5R = A5EvenR + A5OddR;
		const double A5I = A5EvenI + A5OddI;

		signalOut[(i + 4 * step) << 1] = A5R;
		signalOut[((i + 4 * step) << 1) + 1] = A5I;

		// A6
		const double A6EvenR = 0.55557023301960218 * sumA2r - 0.98078528040323043 * sumA4r + 0.19509032201612836 * sumA6r + 0.83146961230254524 * sumA8r;
		const double A6OddR = a1 - 0.38268343236508978 * sumA3r - 0.70710678118654757 * sumA5r + 0.92387953251128674 * sumA7r - a17;

		const double A6EvenI = 0.83146961230254524 * sumA2i + 0.19509032201612836 * sumA4i - 0.98078528040323043 * sumA6i + 0.55557023301960218 * sumA8i;
		const double A6OddI = 0.92387953251128674 * sumA3i - 0.70710678118654757 * sumA5i - 0.38268343236508978 * sumA7i - a9 + a25;

		const double A6R = A6EvenR + A6OddR;
		const double A6I = A6EvenI + A6OddI;

		signalOut[(i + 5 * step) << 1] = A6R;
		signalOut[((i + 5 * step) << 1) + 1] = A6I;

		// A7
		const double A7EvenR = 0.38268343236508978 * sumB2r - 0.92387953251128674 * sumB4r;
		const double A7OddR = a1 - 0.70710678118654757 * sumB3r - a9 + a17 - a25;

		const double A7EvenI = 0.92387953251128674 * sumB2i - 0.38268343236508978 * sumB4i;
		const double A7OddI = 0.70710678118654757 * sumB3i + a5 - a13 + a21 - a29;

		const double A7R = A7EvenR + A7OddR;
		const double A7I = A7EvenI + A7OddI;

		signalOut[(i + 6 * step) << 1] = A7R;
		signalOut[((i + 6 * step) << 1) + 1] = A7I;

		// A8
		const double A8EvenR = 0.19509032201612828 * sumA2r - 0.55557023301960218 * sumA4r + 0.83146961230254535 * sumA6r - 0.98078528040323043 * sumA8r;
		const double A8OddR = a1 - 0.92387953251128674 * sumA3r + 0.70710678118654757 * sumA5r - 0.38268343236508978 * sumA7r - a17;

		const double A8EvenI = 0.98078528040323043 * sumA2i - 0.83146961230254535 * sumA4i + 0.55557023301960218 * sumA6i - 0.19509032201612828 * sumA8i;
		const double A8OddI = 0.38268343236508978 * sumA3i - 0.70710678118654757 * sumA5i + 0.92387953251128674 * sumA7i + a9 - a25;

		const double A8R = A8EvenR + A8OddR;
		const double A8I = A8EvenI + A8OddI;

		signalOut[(i + 7 * step) << 1] = A8R;
		signalOut[((i + 7 * step) << 1) + 1] = A8I;

		// A9
		signalOut[(i + 8 * step) << 1] = sumOddOddA - sumOddOddB;
