		signalOut[(i + 12 * step) << 1] = A5OddR - A5EvenR;
		signalOut[((i + 12 * step) << 1) + 1] = A5EvenI - A5OddI;

		// A14
		signalOut[(i + 13 * step) << 1] = A4OddR - A4EvenR;
		signalOut[((i + 13 * step) << 1) + 1] = A4EvenI - A4OddI;

